const Log = (props) => {
    return (
        <section className="log">
            <section className="log-title-bar">
                <h2>My Log</h2>
                <section className="date-navigator">
                    <span className="previous-date">&lt;</span>
                </section>
            </section>
            <style jsx>{`
                .log {
                    margin-top: 20px;
                }
                .log .log-title-bar {
                    border-bottom: 1px solid rgba(255,255,255,.2);
                    padding-bottom: 3px;
                }
                .log-title-bar h2 {
                    font-size: .8rem;
                    font-weight: normal;
                }
            `}</style>
        </section>
    )
};

export default Log;
